import React from "react";
import './home.css';
import Ducky from '../components/Ducky.png';

const Home = () => {
    return (
        <div className>
            <p>Greetings Ducky fan.</p>
            <img className='Ducky' src={Ducky} />
        </div>
    );
};

export default Home;
